import './App.css';
import React from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { faTwitter, faFontAwesome } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

library.add(fas, faTwitter, faFontAwesome)

function LogIn() {
  return (
    <div id='login'>
      <p>Iniciar Sesión</p>
      <form>
        <div class="form-floating mb-3">
          <input type="email" className="form-control" id="floatingInput" placeholder="name@example.com" />
          <label for="floatingInput">Email address</label>
        </div>
        <div class="form-floating">
          <input type="password" className="form-control" id="floatingPassword" placeholder="Password" />
          <label for="floatingPassword">Password</label>
          </div>
      </form>
    </div>
  );
}

function HomePage() {
  return(
    <div id="homepage" className='conteiner-fluid d-flex flex-column  align-items-center justify-content-center'>
      <div>
        <button type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-user" style={{color: "#613583",}} /></button>
        <p>Iniciar Sesión</p>
      </div>
      <div>
        <button type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fa-solid fa-address-card" style={{color: "#613583",}} /></button>
        <p>Registrarse</p>
      </div>
      <div>
        <button type="button" className="btn btn btn-outline-primary"><FontAwesomeIcon icon="fas fa-magnifying-glass" style={{color: "#613583",}}/></button>
        <p>Sucursales</p>
      </div>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <HomePage />
    </div>
  );
}

export default App;
